import React from 'react';
import { NavLink } from 'react-router-dom';
import { NavList } from './styles';

export const Menu = () => {

    return(
       
         <NavList>
             <NavLink to="/estoque"><li>Estoque</li></NavLink> <br />
             <NavLink to="/financeiro"><li>Financeiro</li></NavLink> <br />
        </NavList>           
       
    )
}
